import React from "react";
import "./maillist.css";

const MailList = () => {
  return (
    <div className="mail">
      <h1 className="mailTitle">Save time, save money!</h1>
      <span className="mailDesc">
        sign up and we'll send the best deals to you
      </span>
      <div className="mailInputContainer"></div>
    </div>
  );
};

export default MailList;
